import React from 'react';
import styled from 'styled-components';
import Bg1 from '@mevron/cross-core/assets/svg-icon/color-svg/custom-11.svg';

const StatsCard = ({ title }) => {
    const Container = styled.div`
        background-position: right bottom;
        background-repeat: no-repeat;
    `;
    return (
        <div className="col-xl-3 col-md-6 col-12">
            <Container className="box bg-secondary-light pull-up" style={{ backgroundImage: `url(${Bg1})` }}>
                <div className="box-body">
                    <div className="flex-grow-1">
                        <div className="d-flex align-items-center pe-2 justify-content-between">
                            <div className="d-flex">
                                <span className="badge badge-primary me-15">{title}</span>
                            </div>
                        </div>
                        <h4 className="mt-25 mb-5">40</h4>
                    </div>
                </div>
            </Container>
        </div>
    );
};

export default function Stats() {
    return (
        <div className="row">
            <div className="col-12">
                <div className="box no-shadow mb-0 bg-transparent">
                    <div className="box-header no-border px-0">
                        <h4 className="box-title">Case Type</h4>
                    </div>
                </div>
            </div>
            <StatsCard title="FHR" />
            <StatsCard title="Criminal" />
            <StatsCard title="Plea Bargaining" />
            <StatsCard title="Closed Cases" />
        </div>
    );
}
